What’s Next Podcast with Umindi Francis kicks off a new season with…drum roll…𝗝𝗲𝘀𝘀𝗲𝗹 𝗧𝗮𝗮𝗻𝗸! 

Jessel Taank is the breakout star in the reboot of Bravo’s The Real Housewives of New York. This season, the fan favorite shared intimate details of her life and journey that truly resonated with the audience. Raised in London in a tight knit, traditional Indian household, Jessel followed her dream, and moved to the Big Apple to make it…well…𝘽𝙄𝙂. She became a Fashion Publicist, and that’s how we met some 15 years ago. Today she’s a wife (to the season’s other break out star!!) a mom to twin boys who keep her on her toes, and now an entrepreneur. This month she launches Ōushq @oushq an e-commerce platform for Indian fashion. We get into it all! Tune in @applepodcasts @googlepodcasts @spotifypodcasts @youtube 

